import { Fragment } from "react";
import "./caught.css";

function Caught({ catchList }) {
  console.log("catchList");
  console.log(catchList);
  return (
    <Fragment>

          <ul>
      {catchList.map((pokemon) => (
        <li>{pokemon.name}</li>
      ))}
    </ul>
    </Fragment>

  );
}

export default Caught;
